Новый жилой комплекс “Дніпровська Мрія” располагается в Днепровском районе Киева на улице Сосюры, 6. Застройщик – надежна компания «ГАЛжитлобуд», которая уже 4 года успешно предоставляет свои услуги.


Двухуровневая трёхкомнатная квартира общей площадью 102 м2. Площадь первого уровня – 49 м2, второго – 53 м2. Есть просторный холл, гардеробная, лоджия. Два сдельных санузла. Установлены металлопластиковые окна и входные противоударные и противопожарные двери и металлопластиковые окна. Отличный вариант для большой семьи!


На территории комплекса вскоре буду обустроены зоны отдыха, детские игровые и спортивные площадки, футбольное мини-поле, магазины, кафе, клиники, салоны красоты, подземный паркинг и гостевая парковка.


В максимальной близости от ЖК есть:


• Школы: №31, №146, №176, №99;


• Детские садики: №274, №297, №412;


• Супермаркеты: Сильпо, АТБ, Билла, Велика кишеня;


• ТЦ и ТРЦ: Проспект, Мега-Сити;


• Рестораны: Tbiliso, Spezzo;


• Медицинские учреждения: «Поликлиника №2», «Медицинский центр», «Стоматологическая поликлиника».


Удобное расположение комплекса позволяет добраться практически в любую точку города. К ближайшим станциям метро Дарница и Черниговская – всего 10-20 минут езды общественным транспортом. При наличие собственного авто до центра города с ЖК можно добраться всего за 15-20 минут.


Чтобы более подробно ознакомится со всеми преимуществами ЖК, звоните или лично приезжайте в наш офис.

Компанія: Галжитлобуд

Новий житловий комплекс "Дніпровська Мрія" розташовується в Дніпровському районі Києва на вулиці Сосюри, 6. Забудовник - надійна компанія «ГАЛжитлобуд», яка вже 4 роки успішно надає свої послуги на території України. Встигніть купити квартиру в ЖК «Дніпровська мрія» за акційною ціною. Такого ще не було: будинок значно вирыс, а ціни впали! Поспішайте, кількість акційних квартир обмежена.


Трикімнатна квартира площею 85/50/14 м2. Є два санвузли, лоджія. Майбутніх мешканців порадує просторий передпокій. У квартирі встановлені металопластикові вікна з двокамерними склопакетами.


На території комплексу буде своя власна інфраструктура: магазини, кафе, ресторани, салони краси, клініки, зони відпочинку, футбольне міні-поле, дитячі ігрові та спортивні майданчики, підземна парковка і гостьовий паркінг.


У максимальній близькості від РК є:


• Школи: №31, №146, №176, №99;


• Дитячі садки: №274, №297, №412;


• Супермаркети: Сільпо, АТБ, Білла, Велика кишеня;


• ТЦ і ТРЦ: Проспект, Мега-Сіті;


• Ресторани: Tbiliso, Spezzo;


• Медичні установи: «Поліклініка №2», «Медичний центр», «Стоматологічна поліклініка».


До найближчих станцій метро Дарниця і Чернігівська - 13-20 хв на громадському транспорті. З ЖК є виїзд до проспекту Юрія Гагаріна і Харківському шосе.


