В Святошинском районе города расположился новый ЖК Академ-квартал. Это один из тех киевских микрорайонов, где дома гармонично вписались в природную среду. Тишина и близость природы привлекают в этот район ценителей спокойной жизни вдали от суетного города. Застройщиком выступает надёжная компания Интергал-Буд. Сегодня вы можете купить квартиру в рассрочку до 5 лет.


Большая трёхкомнатная квартира, общая площадь которой составляет 93 м2. В квартире есть две спальни площадью 15 м2 и 14 м2, гостиная – 18 м2, просторная кухня – 17 м2, санузел – 3 м2 и лоджия – 3 м2.


Инфраструктура комплекса отлично подходит для проживания семей с детьми! На территории ЖК планируется обустройство детских и спортивных площадок, алей для прогулок с авторским ландшафтным дизайном, зон для отдыха. Рядом с домом будет обустроена автостоянка. Планируется строительство детского сада.


Вы будете жить в районе с развитой инфраструктурой. Поблизости к комплексу расположены:


• Супермаркеты Новус, АТБ, Фора;


• ТРЦ Lavina, Multiplex Lavina Mall – всего 5 минут езды от дома;


• Спортклуб Дії, Спортивний клуб Олимп;


• Медицинские учреждения: Детская больница №5, Лаборатория Синєво, Медицинский центр Сан Мэдикэл Клиник;


• пиццерия Mamamia, пиццерия MYPIZZA, McDonald's, кафе Crazy family, ресторан Апельсин;


• Отделения Новой почты и Приват Банка.


От дома до станции метро Академгородок – всего 10 минут езды общественным транспортом. Возле комплекса курсируют автобусы и маршрутные такси, которые довезут вас в разные районы столицы.


